values:
In June of 2014 I had a book released as part of The Secrets of Neverwood Anthology. I love the stories of Cal, Danny and Devon, the three men whose step mother Audrey left them the crumbling Victorian mansion and grounds that had been fancifully named &#39;Neverwood&#39;. The three grown foster children who Audrey loved accepted the challenge of restoring the house for it&#39;s previous purpose, to house displaced boys, some with reluctance but with a determination to honor the woman they called mother. I&#39;m proud to have a book in this anthology; the other two authors are <lj user="Libby_drew" /> and <lj user="GB_Lindsey" />, and I was humbled to be included with them.

I thought I was done with Danny, my foster brother for the series, and Sam, his partner. But it seems I wasn&#39;t. I know anyone reading this who writes understands when characters aren&#39;t done with you, when they begin to whisper in your ear again, even if you&#39;re up to your chin in another project. And if you ignore them, everything creative grinds to a halt. So I finally gave in to Danny, the obnoxious little shit, and wrote this for him. It&#39;s a Coda, and glimpse into where he and Sam are now, and I enjoyed writing it. I hope you enjoy reading it!

<lj-cut>ONE STEP CLOSER

Danny had wanted to work later. Ever since the switch to daylight savings time, and they&rsquo;d &lsquo;sprung forward&rsquo;, it was lighter well into the evening and he wanted to take advantage of it. And he&rsquo;d tried. But by five thirty the breeze picked up and his fingers were going numb. Cursing under his breath after he dropped his clippers for the third time, he gathered the bucket full of snipped, dried twigs and headed for the planting shed at the side of the garage.

It was much warmer inside thanks to the small heaters he&rsquo;d turned on that morning. He dumped his tools just inside the door and crossed to the grow lights, checking the seedlings on the racks against the wall. The tiny plants looked none the worse for wear due to the freeze the night before, and he exhaled softly in relief. He could always start them again, but&hellip; he&rsquo;d never admit it to a living soul, but he grieved a little when the babies didn&rsquo;t make it. They were so fragile in this state. Covering them carefully with plastic, he turned the heaters down to low and made sure they were a safe distance from the wall before closing up and heading to the back door.

He heard a twig snap and stopped, looking out over the forested side of the Neverwood property. It had been a long time since they&rsquo;d had any trouble, but he remained vigilant. Lavender shadows stretched long between the close set trees and the thick underbrush dipped and swayed slightly in the cold breeze. He didn&rsquo;t move, his eyes scanning the verdant dimness, and then he saw her; a full grown doe, picking her way carefully through the gloom. Her head came up and she paused, huge Bambi eyes on him, long lashes quivering.

&ldquo;Hello, beautiful,&rdquo; he murmured. &ldquo;Where&rsquo;s the bubba?&rdquo;

It was a moment longer before he saw the tiny fawn stick its little nose out from around one of the thick pines. He smiled. No more than a week old, its velvety coat marked with tiny white spots, the baby had stolen his heart the moment he&rsquo;d seen him. He watched as mother and infant nibbled on one of the maiden hair fern plants that grew close to the ground, and then casually disappeared back further amidst the trees. They were safe on the Neverwood grounds. Even though it wasn&rsquo;t hunting season not all hunters were ethical and he&rsquo;d spotted a baby with an arrow through one of its hind legs the season before. Danny didn&rsquo;t exhibit his emotions much, but the sight of that poor hobbled baby had brought tears to his eyes.

&ldquo;Keep them here, Mom,&rdquo; he murmured, feeling his voice slip into the breeze. &ldquo;Keep them safe.&rdquo;

&ldquo;I&rsquo;ll do what I can, but they don&rsquo;t always listen. Much like my boys.&rdquo;

The voice sounded near his ear, so soft it might almost have been his imagination, but he knew better. Hearing it brought a smile.

Audrey still spoke to him occasionally. The beloved foster mother of Danny and his two adopted brothers Cal and Devon, Audrey Rasmussen brought the boys together when she left them Neverwood, the crumbling Victorian mansion where each had spent part of their childhood.
After she&rsquo;d passed from ovarian cancer, Danny thought he was losing it when he began to hear her voice. Then he found out Audrey was visiting each of &lsquo;her boys&rsquo; in a different fashion: he could hear her, Cal dreamt of her, Devon could feel her. She hadn&rsquo;t been around much lately; each of her sons had found a measure of happiness and the corrupt contractor who tried to steal Neverwood from them was still in jail. It took months, but he was convicted of breaking and entering and attempted murder.

Audrey saved them all the night he&rsquo;d broken into the house and confronted them in the attic. She&rsquo;d put on quite a light show, attacking him, chasing him from the house. Danny supposed it was a good thing when she turned up less frequently; maybe it meant they were doing something right.

Once the doe and her offspring were hidden amongst the trees, Danny climbed the back steps, entering the huge old house through the kitchen door. The moment he was inside, his senses were assaulted on multiple fronts. Warm air brushed over his cold face, and the scent of lasagna and garlic bread filled the air. He inhaled gratefully. He&rsquo;d forgotten it was Tuesday and therefore Italian night, but he was happy to be reminded. Cal made a mean lasagna, and he knew there were at least eight pans divided between the two ovens. It took that much to feed the nine adults and thirteen kids who lived at Neverwood full time, not to mention any of Cal&rsquo;s group who chose to hang around after their weekly meeting. They must be up in the second floor lounge, he thought. That would explain why Wes, Cal&rsquo;s building contractor boyfriend, was currently sitting at the kitchen table, dividing his attention between to the two youngest residents of Neverwood, each in a high chair.

&ldquo;You pull rug rat duty?&rdquo; Danny grinned as he crossed to the sink to wash his grubby hands. He turned on the tap and sighed in relief as the warm water flowed over his cold fingers.

&ldquo;I did,&rdquo; Wes answered, trying to feed little Megan a bite of baby food. She was having none of it, pulling her face to the side to avoid whatever it was Wes had on the spoon. &ldquo;Cal sent out an s.o.s. earlier this afternoon. Aw, come on, baby. You&rsquo;ve got to eat.&rdquo;

&ldquo;She probably wants lasagna,&rdquo; Danny quipped.

Their plan, once Neverwood was repaired and back up to safety codes so they could reopen its doors, had been to take in displaced gay boys, as Audrey had done. But the system was so overloaded that once they&rsquo;d passed their state certification they&rsquo;d become a &lsquo;safe house&rsquo; for babies in crisis situations, too. When local law enforcement first approached them about it, they hadn&rsquo;t been sure they were qualified. But as Cal said, they were better than a play pen in a police station or being bounced from foster to foster. Most of them weren&rsquo;t with them long but while they were there they were part of the family. Like little Megan, whose dad was in jail and whose mom had checked herself into rehab.

&ldquo;Come on, sweetie,&rdquo; Wes begged. &ldquo;If you don&rsquo;t eat, Calvin will have my hide.&rdquo;

&ldquo;Oh, sure.&rdquo; Danny pulled a paper towel from the roll and dried his hands. &ldquo;If that means he&rsquo;ll have you flat on your back at bedtime.&rdquo;

&ldquo;Daniel!&rdquo; Wes gave him an exaggerated scowl. &ldquo;Not in front of the infants.&rdquo;

Danny laughed and crossed to them, leaning down to rub his cold cheek against the other baby, little Connor. The bright eyed eighteen month old giggled and reached out with his pudgy baby hands, grabbing Danny&rsquo;s lower lip. Connor&rsquo;s sixteen year old mother left him at a local fire station, and his grandmother was currently attempting to get custody. Cal wasn&rsquo;t sure how he felt about turning the boy over to a woman who had kicked her pregnant daughter out, but he was always very protective of the babies. &ldquo;They&rsquo;re the most vulnerable,&rdquo; Cal said. &ldquo;They need us the most.&rdquo;

&ldquo;Easy there, champ,&rdquo; Danny said, pulling the small hand away and placing a noisy kiss on the sticky palm. &ldquo;No damaging the money maker.&rdquo; He hooked a chair with his booted foot and pulled it over, sitting and picking up the spoon and jar of toddler food that was on the table.

&ldquo;Thanks,&rdquo; Wes said, sounding relieved. &ldquo;I don&rsquo;t know how Cal feeds them both at once.&rdquo;

&ldquo;It&rsquo;s a gift,&rdquo; Danny agreed. He glanced at the contents of the jar and made a face, then read the label.

&ldquo;Sweet potatoes, huh? Looks like shit to me, but if you like it&hellip;&rdquo; He took some on the small spoon and fed it to Connor, who smiled at him, pureed sweet potatoes dripping down his chin. &ldquo;Lovely.&rdquo; He grimaced.

&ldquo;The first time one of them says the s-word to a social worker, I&rsquo;m pointing them right in your direction, Danny boy.&rdquo; Wes tried another spoon full for Megan, and she took it in her mouth just long enough to spit it back at him. Danny chuckled as Wes stiffened, and then wiped it from his chin with a cloth.&nbsp;&ldquo;Okay, you&rsquo;re done.&rdquo;

He screwed the lid back on the jar.

&ldquo;Get her some Cheerio&rsquo;s,&rdquo; Danny said, feeding Connor another bite. &ldquo;She loves them, they&rsquo;re good for her, and she won&rsquo;t cry later because she&rsquo;s hungry.&rdquo;

&ldquo;Sold.&rdquo; Wes crossed to the butler&rsquo;s pantry and disappeared inside, then returned holding the box of cereal. When she saw it, Megan grinned in delight and banged on her tray. &ldquo;Is this all it takes?&rdquo; He shook the box, then opened it and poured some onto the high chair tray. She dove for them and shoved several into her mouth at once, sending Wes another toothless grin. He shook his head. &ldquo;How did you know about these?&rdquo;

&ldquo;I&rsquo;m usually around when they&rsquo;re getting breakfast.&rdquo; Danny fed Connor another bite, and he clapped his little hands together in delight. Wes watched them with a bemused expression. &ldquo;What?&rdquo; Danny asked finally, feeling his gaze.

&ldquo;Nothing. It&rsquo;s just -- for some reason I thought you&rsquo;d be the last person who liked the babies.&rdquo;

&ldquo;I love the babies.&rdquo; Danny made a face at Connor and he giggled. &ldquo;They&rsquo;re the only ones I&rsquo;m taller than.&rdquo;

&ldquo;That&rsquo;s the god&rsquo;s honest truth.&rdquo; Danny&rsquo;s oldest brother Devon said as he pushed in through the kitchen door, his dark hair mussed and a coffee cup in his hand. His shirt was wrinkled and his eyes looked tired, and he crossed to the coffee maker, saw the empty pot and cursed extravagantly.

&ldquo;And it&rsquo;ll be MY fault if they cuss?&rdquo; Danny said wryly. &ldquo;I think we can blame old potty mouth over there.&rdquo;

&ldquo;Oh, stow it, brat,&rdquo; Devon grumbled, opening the cupboard and pulling out a container of ground coffee. He yanked out the coffee maker drawer, dropping in a filter and scooped some coffee from the bag.

&ldquo;Pulling an all-nighter?&rdquo; Wes asked.

&ldquo;That was last night, hence &ndash; &ldquo; He held up the empty cup. &ldquo;I&rsquo;d like to get this assignment done and I keep dozing off in front of the monitor.&rdquo;

&ldquo;Where&rsquo;s Nick?&rdquo; Danny asked. &ldquo;Still at the high school? I didn&rsquo;t see his car.&rdquo; Devon&rsquo;s partner, Nicholas, taught Math to grades nine through 12.

&ldquo;Algebra two on the sun porch,&rdquo; Devon answered, pouring water into the machine. &ldquo;And the Bronco is in the shop.&rdquo;

&ldquo;Again?&rdquo; Danny made a face. &ldquo;He needs a new car.&rdquo;

Devon chuckled. &ldquo;So Robbie keeps telling him.&rdquo;

Wes snorted. &ldquo;Robbie just wants there to be a new one for when he gets his permit.&rdquo; Robbie, Nick&rsquo;s son, was almost sixteen and chomping at the bit to drive.

&ldquo;Hey, whatever keeps him off my bike.&rdquo; Devon&rsquo;s beloved Harley was currently parked in the garage and had been declared off limits to fledgling drivers, but that didn&rsquo;t stop Robbie from asking. Devon leaned against the counter and rubbed his red rimmed eyes as the coffee maker hissed and began dripping.

The door from the dining room swung open again and Cal came through followed by two of the boys from his group. He leaned over as he passed and picked up a Cheerio from Megan&rsquo;s tray. He popped it in his mouth.

&ldquo;I see you&rsquo;re taking parenting tips from Danny,&rdquo; he said dryly, softening the criticism by pressing his lips to Wes&rsquo;s. When he would have pulled away, Wes grabbed the front of his Henley, holding him in place, deepening the kiss. Cal smiled into it.

&ldquo;Yuck,&rdquo; Danny whined, looking at Devon. &ldquo;Dad, make them stop.&rdquo;

The two teenage boys with Cal laughed when Devon flipped him the bird. Cal finally pulled back, his hand smoothing over Wes&rsquo;s strawberry blond curls as he gave him an intimate smile. He then turned to Danny. &ldquo;You&rsquo;re just jealous because Sam&rsquo;s been gone for two weeks and you aren&rsquo;t getting any.&rdquo;

&ldquo;True,&rdquo; Danny replied. &ldquo;So, stop reminding me that the fruit of my loins isn&rsquo;t going to be back any time soon, okay?&rdquo;

Devon laughed. &ldquo;The &lsquo;fruit of your loins&rsquo;? I am so telling Sam you called him that.&rdquo;

Danny just shrugged. &ldquo;Better than some of the things I&rsquo;ve called him to his face.&rdquo;

&ldquo;Why the man loves you, I have no idea.&rdquo; The coffee machine began to sputter, and Devon turned with a grateful sigh and poured himself a cup even before the stream had stopped. The hot liquid hissed on the warming plate.

&ldquo;Oy, were you raised in a barn?&rdquo; Cal complained, pushing him out of the way as he picked up a sponge and wiped up the spill and the bottom of the clear glass pot.

&ldquo;Now, boys. Play nice.&rdquo; Danny grabbed the damp cloth Wes had used on Megan&rsquo;s face and wiped Connor down, then tossed the empty jar across the kitchen into the recycling bin. He threw up his hands when it landed with a thud. &ldquo;Score!&rdquo;

&ldquo;Nice teachable moment, there, Daniel.&rdquo; Cal gave him a dark look then turned to the teenagers. &ldquo;We do not throw glass jars across the kitchen. Really.&rdquo;

&ldquo;Right,&rdquo; Danny said with mock solemnity. &ldquo;Never. Ever. We don&rsquo;t do that.&rdquo; He stood and leaned over to buss Connor on the cheek then leaned quickly away when a musty odor filled his nostrils. &ldquo;Whew.&rdquo; He picked the baby up under his arms and held him out to Cal. &ldquo;Time for Daddy Cal.&rdquo;

Cal took the baby, then made a face. &ldquo;Why can&rsquo;t Daddy Danny take care of this?&rdquo;

&ldquo;Because Daddy Danny will whoops his cookies if he tries,&rdquo; Danny answered. &ldquo;Plus, I need a shower.&rdquo;
He started for the kitchen door.

&ldquo;Danny.&rdquo; He stopped and looked back at Cal. &ldquo;Dress nice.&rdquo;

Danny frowned. &ldquo;For dinner with the crew? Why?&rdquo;

Cal looked down and rubbed noses with the baby. &ldquo;Because. We&rsquo;re having company for dinner.&rdquo;
Danny scowled. &ldquo;Who?&rdquo;

&ldquo;Sal&rsquo;s bringing the new social worker by,&rdquo; Cal answered. Sal was their contact at Child Services.

&ldquo;Shit. I&rsquo;m going to Burger King.&rdquo;

&ldquo;You aren&rsquo;t,&rdquo; Cal said, giving him a direct look. &ldquo;And don&rsquo;t cuss in front of the babies. The first time one of them says the s-word in front of a social worker&hellip;&rdquo;

Danny threw his hands up when Wes laughed. &ldquo;I swear to God, you two share a brain. And fine, I&rsquo;ll &lsquo;dress nice&rsquo;, whatever the hell that means.&rdquo;

&ldquo;It means slacks and a sweater, not torn up jeans and a t-shirt. And let&rsquo;s go clean you up, sir,&rdquo; Cal said to a grinning Connor, &ldquo;before Daddy Cal whoops his cookies.&rdquo; He pushed past Danny. &ldquo;I mean it,&rdquo; he said pointedly. &ldquo;Nice.&rdquo;

&ldquo;Fine.&rdquo; Danny grimaced.

Devon raised his mug to the two teenage boys, who were leaning against the kitchen counter and grinning.

&ldquo;Welcome to the madhouse, boys. Staying for lasagna?&rdquo;

After standing under the shower spray until the water started to go cold, which wasn&rsquo;t long in the big old house, Danny emerged and rubbed his dark hair nearly dry with a towel. He squeezed some hair gel into his hands and rubbed it into his dark hair, then ran a comb through it as he stared in the foggy mirror over the sink. &lsquo;That&rsquo;s as good as it&rsquo;s going to get&rsquo;, he thought, wrapping a towel around his waist before walking into the corner bedroom he shared with Sam. He stepped into a pair of briefs, and then stood in the doorway to the large closet studying his wardrobe. He finally chose black Levi&rsquo;s and a white sweater, but didn&rsquo;t reach for them right away. He was distracted by Sam&rsquo;s pants and shirts, hanging across from his. Stepping in, he sniffed the dark gray sweater Sam wore the last night he&rsquo;d been home two weeks before. The scent of Sam&rsquo;s cologne clung to the fabric. Making a sound in the back of his throat, Danny caught the soft wool in his hand and buried his face in the neckline, inhaling deeply. A tight, squeezing sensation gripped his heart. God, he missed him.

Sam Ignatious, the love of Danny&rsquo;s life, was in Seattle installing a yard and garden for an old client. It was a five figure job, too much for him to turn down while he was saving for a new truck, but it was taking longer than they&rsquo;d thought it would. The client kept adding paths and gates and rock gardens, and Danny briefly considered going over to join him. He wasn&rsquo;t comfortable leaving Neverwood&rsquo;s massive grounds just when spring was settling over Eastern Washington, however. In Seattle things had been blooming for weeks, but not in Elk Ridge, the small community not far from the Idaho border. Even though the crocuses along the fence line were in riotous bloom, they could still get snow. Sam called every day and they Skyped once a week, but it wasn&rsquo;t the same as having Sam there, in his arms. Determined to tell Sam it was time for him to come home at least for a weekend, he took out his slacks and ignored the white sweater, pulling out Sam&rsquo;s instead. It would be too big for him, but at least the scent of his lover would be with him for the evening.

He could hear voices in the dining room as he came down the stairs, and Danny smiled faintly. He hoped this new social worker was made a sturdy stuff; dinner at Neverwood could be a bit overwhelming for the uninitiated. With so many people it was usually accomplished with twenty in the massive dining room and eight to ten on stools around the butcher block with the kitchen door open in between. The babies had already eaten but they were there, too, in their high chairs, adding to the din. It would be noisy and raucous but to Danny the first time they&rsquo;d had more than the seven of them around the huge, scarred old mahogany table in the dining room was the first time he&rsquo;d truly felt at home. The more extending leaves they added to the table, the more he felt Audrey&rsquo;s benevolent spirt lingering around them. She&rsquo;d loved nothing better than surrounding herself with &lsquo;her boys&rsquo;, and feeding a crowd. Danny secretly thought Cal felt the same.

He heard laughter and the low murmur of the voices and hoped he wasn&rsquo;t too far behind the hoard. The policy at Neverwood at meal time was &lsquo;you snooze, you lose&rsquo;, and his stomach growled at the delectable smell wafting through the downstairs. He pushed through the dining room door, hoping he hadn&rsquo;t missed out on the lasagna.

He didn&rsquo;t see what he expected to.

The babies and the little ones were in their seats, eight kids in all, but everyone ten and up seemed to be gone. Nick was sitting at the far end, deep in conversation with his son, Robbie, and Devon was pouring milk into plastic cups then screwing on tops with straws. Danny could see into the kitchen and it looked empty but for Cal and Wes, who were plating food. Danny frowned.

&ldquo;Where are all the big kids?&rdquo;

&ldquo;Change of plans.&rdquo; Cal looked up at him. &ldquo;Madge and her daughters took them into Spokane for burgers and to see a movie.&rdquo;

Madge worked in the kitchen three days a week and her daughters helped out so they were familiar with the boys.

&ldquo;That was brave.&rdquo; Danny went to his seat halfway down the table, noting that it was set with china and Audrey&rsquo;s sterling. They didn&rsquo;t usually go in for fancy, but then he remembered the new social worker. &ldquo;Sal and her guest running late?&rdquo;

&ldquo;They should be here any minute.&rdquo; Wes gave Danny a wry smile, studying the sweater with its too long sleeves that he&rsquo;d shoved up to his elbows and the length that hit him mid-thigh. &ldquo;Nice sweater. Looks like something I&rsquo;ve seen Sam wear.&rdquo;

Danny ignored him but shoved at the sleeves.

The kids were chattering as Cal brought plates into the room. He set them before Devon, who picked up a knife and fork and began cutting the servings of lasagna into little kid bite sized pieces. Cal and Wes passed in the doorway, grinning when their hips brushed. Nick laughed at something Robbie said, then stood and began helping Devon get the plates prepared.

It was all so domestic, the pattern they&rsquo;d fallen into. They made adjustments when one of them was gone; when Nick was taking Robbie to see his Mom, or Devon was away on a shoot. Or Sam was in Seattle. But they did what needed to be done for their charges, always. Thinking of how Sam usually took care of the sippy cups, filling them with milk or juice, made Danny miss him even more. Pushing down his melancholy, he got up and began taking a cup of milk to each of the children, grabbing garlic bread from a platter in the middle of the table and adding it to the plates as Devon finished with them. He rubbed one little boy&rsquo;s head, smiled at another. There was food in front of each of the kids in record time. The noise level dropped dramatically as they dug in.

The doorbell sounded through the downstairs.

&ldquo;I&rsquo;ll get it,&rdquo; Danny said.

&ldquo;No,&rdquo; Nick said quickly. He and Devon exchanged a look. &ldquo;I&rsquo;ll get it.&rdquo;

&ldquo;You do that, Dad,&rdquo; Robbie said, a mischievous look on his handsome, teenaged face. He took a bite of garlic bread. &ldquo;You get that door.&rdquo;

Devon shot Robbie a quelling look as Nick wiped his hands on his khaki trousers, almost as if he was nervous, as he left the room.

&ldquo;So, this is supposed to be the social worker?&rdquo; Robbie&rsquo;s eyes were bright as he looked from Devon to Cal, who was standing in the doorway, a dish cloth in his hands. Devon smacked him on the back of the head as he returned to his place at the huge table and pulled out his chair.

Robbie rubbed the spot. &ldquo;Good timing on that. I can report Devon for child abuse.&rdquo;

&ldquo;Will you put a sock in it?&rdquo; Devon growled but Robbie just grinned.

Something about the whole thing began to strike Danny as very odd. His brother&rsquo;s and their partners were on edge, and Robbie was clearly in on it and enjoying their discomfort. The majority of the kids were gone, the table was set with linen napkins and silver flatware&hellip; Dimly he was aware of the sound of the heavy front door opening and then voices coming their way.

&ldquo;What&rsquo;s going on?&rdquo; Danny demanded. His brothers looked at him, then Devon shrugged and Cal and Wes exchanged another of those enigmatic looks. Danny opened his mouth, but there wasn&rsquo;t time for anything else. The dining room door swung open and Danny turned, freezing at what he saw.

Nick was holding the door open for Sam&rsquo;s sisters, Dana and Leslie. Dana was holding a pie and Leslie was carrying what looked like a large container of cupcakes. Even more startling, behind them came Sam&rsquo;s father, city councilman Bernard Ignatious.

At one time the senior Ignatious had tried everything he could to have Neverwood taken from Audrey&rsquo;s boys and torn down. That had changed, and he&rsquo;d even come to accept Danny&rsquo;s relationship with his son, but having him calmly enter their dining room was still a shock. They saw Danny, and Dana smiled brightly.

&ldquo;Hello, handsome,&rdquo; Dana said, kissing his cheek as she passed on her way to the kitchen. &ldquo;Cherry pie, Cal,&rdquo; she called. &ldquo;I hope that&rsquo;s okay.&rdquo;

&ldquo;It&rsquo;s excellent, thank you.&rdquo; Cal took the pie and set it on the butcher block.

&ldquo;I brought chocolate cupcakes.&rdquo; Leslie smiled, squeezing Danny&rsquo;s arm as she followed her sister. He stared after them, for once in his life startled into silence.

&ldquo;I call dibs on those,&rdquo; Robbie said with an irrepressible grin.

&ldquo;There&rsquo;s enough for everyone.&rdquo; Leslie tousled Robbie&rsquo;s dark hair as she passed.

&ldquo;Daniel.&rdquo;

Bernard Ignatious offered his hand, and after a stunned pause, Danny shook it.

&ldquo;Sir,&rdquo; he said faintly. He turned and looked at Devon, who was watching him with an amused expression. &ldquo;What the hell?&rdquo; he mouthed, and Devon grinned. &ldquo;Uhm, did I miss something?&rdquo; Danny asked the room at large.

&ldquo;Hey, babe.&rdquo;

Danny whirled, his heart jumping into his throat.

Sam was standing just inside the dining room door. He looked tall and lean and fantastic, his sandy blond hair combed back revealing the beautiful bone structure and the deep brown eyes Danny so loved. His first impulse was to go to Sam, wrap his arms around his neck and pull him down to kiss the living daylights out of him. But something stopped him, whether it was the look in Sam&rsquo;s eyes or the expectant faces around the room, he couldn&rsquo;t be sure. Even the little ones were quiet, watching with wide eyes, sensing&hellip; something.

Sam was wearing a dark suit, a gray shirt and a striped tie, and he looked beautiful but very pale. And something else, as well. Like he was -- terrified.

&ldquo;Sam?&rdquo; Danny ventured.

Sam crossed to him and took Danny&rsquo;s hand. It was cold against Danny&rsquo;s palm as he pulled him out from behind his chair.

Danny glanced around at the expectant faces watching them, then back into Sam&rsquo;s eyes.

&ldquo;Did I forget something?&rdquo; he asked, his voice soft. Sam managed a small smile as he shook his head.
Sam licked his lips and Danny could feel him trembling.

&ldquo;Sam, what&hellip;?&rdquo;

&ldquo;Please, just &ndash; don&rsquo;t talk,&rdquo; Sam said finally. &ldquo;I&rsquo;ll never get this out if you don&rsquo;t just &ndash;listen, okay?&rdquo;

Danny stared into his wide eyes and nodded slowly.

&ldquo;I never thought this could happen to me,&rdquo; Sam began. &ldquo;For me. I never thought I&rsquo;d meet someone who could make me want this. But I was wrong. You&rsquo;re &ndash; snotty and sarcastic, and sometimes I want to strangle you.&rdquo; Soft laughter sounded around them, and Danny gave Sam a withering look. He smiled in response. &ldquo;And in spite of the tough guy image you try to project, you&rsquo;re also kind and considerate, and when you love someone, you love them with your whole heart. You loved Audrey, you love your brothers and their partners and the kids here, and &ndash; &ldquo; Sam&rsquo;s smile softened, &ldquo; &ndash; you love me.&rdquo; Sam stuck his hand into his jacket pocket, and then slowly dropped to one knee. Danny&rsquo;s eyes widened.

&ldquo;What are you doing right now?&rdquo; he asked, his voice raw. &ldquo;Sam?&rdquo;

Sam looked up at him, dark eyes shining. &ldquo;Danny Redmond, I love you. I&rsquo;ll always love you. And I want to spend the rest of my life with you. And since the voters in Washington made it legal, I can ask you now.&rdquo; He fumbled in his pocket and withdrew a dark red velvet box. He opened it, and resting against the white satin interior were two black rings, shining along each edge, brushed matte finish in the center. He presented them with a shy smile. &ldquo;Baby,&rdquo; his voice dropped to a soft murmur, &ldquo;will you marry me?&rdquo;

Danny felt like someone had sucked the air from his lungs. His heart slammed into his ribs and unexpected tears sprang to his eyes. He&rsquo;d never even contemplated the idea of marriage. He was unapologetically gay; he&rsquo;d resigned himself to never having the right to marry. And yet, now he could. Not only could he, but the man on his knee in front of him was the only person he could imagine spending the rest of his life with. He stared into Sam&rsquo;s waiting face, felt the people around the room watching them in breathless anticipation, and didn&rsquo;t even try to fight the tears that filled his eyes.

Unable to speak past the huge lump in his throat, Danny nodded. Sam squeezed his hand, hard.

&ldquo;Yes?&rdquo; Sam said, his eyes suspiciously bright. &ldquo;You&rsquo;re saying yes?&rdquo;

&ldquo;Yes,&rdquo; Danny finally managed. &ldquo;Yes, I&rsquo;m saying yes.&rdquo;

There was a rush of happy noise, exclamations and laughter, as Sam took the smaller of the two rings and slipped it onto the third finger of Danny&rsquo;s left hand. His hands were shaking, but he managed to get the other ring onto his own before he dropped the box and stood, pulling Danny into a crushing hug.

He bent his head, his mouth against Danny&rsquo;s ear. &ldquo;I love you,&rdquo; he said. &ldquo;So damned much.&rdquo;

Danny wrapped his arms around Sam&rsquo;s neck, jumping to wrap his legs around his narrow waist. More laughter bubbled up around them.

&ldquo;Classy, Daniel,&rdquo; he heard, but he ignored it in favor of taking Sam&rsquo;s face between his palms and sealing their mouths together in a deep, searching kiss. He wanted to convey how he felt, to make Sam understand what this meant to him, how completely he owned Danny&rsquo;s heart. Their tongues met and moved together, and Sam&rsquo;s hands slid up the back of Danny&rsquo;s thighs, lifting him, holding him in place.

Danny didn&rsquo;t know how long he&rsquo;d been lost in the taste of Sam, the feel of him when a throat was cleared very nearby.

&ldquo;Okay, boys,&rdquo; Audrey murmured, laughter in her voice. &ldquo;This is lovely, but let&rsquo;s ink-thay of the ids-kay.&rdquo;

Danny giggled against Sam&rsquo;s lips. Audrey had occasionally spoken pig-latin around the little ones.
Usually at Christmas time, or near birthdays. Sam pulled back, startled, and looked into Danny&rsquo;s eyes.

&ldquo;Oh my God,&rdquo; he gasped. &ldquo;Was that&hellip;&rdquo;

Danny grinned. &ldquo;It must mean she approves.&rdquo;

&ldquo;She definitely does,&rdquo; her voice whispered.

There wasn&rsquo;t time for more. They were surrounded by their families, Dana wiping at tears and Leslie taking Danny into a hard hug when Sam set him on his feet. Devon took Danny into his arms next, squeezing him tight against his chest.

&ldquo;Congrats, runt,&rdquo; he said, his voice rough. Cal was there next, his hug not as hard but no less sincere.

&ldquo;I&rsquo;m happy for you, Danny,&rdquo; he said, his hand coming up to caress the back of his younger brother&rsquo;s head. &ldquo;You deserve it.&rdquo;

Wes shook his hand, his smile bright, and Nick wrapped his arm around his shoulders, squeezing him against his side. Even Robbie gave him a hug, something Robbie rarely did, and Danny and Nick exchanged a smile over his shoulder.

Then Bernard Ignatious was standing in front of them, and both Sam and Danny became guarded, leaning into one another. Sam&rsquo;s dad had come a long way in the last few months, but neither of them was sure how he would feel about his son marrying another man. He stared at Danny for a long, tense moment.

&ldquo;I haven&rsquo;t always been the best father,&rdquo; the older man finally managed. &ldquo;But if you hurt him, I know where you live.&rdquo;

The laughter around them held more than a bit of giddy relief even as Sam rolled his eyes, his cheeks filling with rusty color.

&ldquo;Way to seize the moment, Dad.&rdquo;

Bernard smiled and offered his hand to his son, then to Danny. He stepped closer, his voice lowered. &ldquo;I wasn&rsquo;t kidding.&rdquo;

Danny squeezed his fingers. All of the work he&rsquo;d done trimming and planting had made his hands strong, and the senior Ignatious looked startled. &ldquo;I didn&rsquo;t for a moment think you were,&rdquo; Danny said. &ldquo;But you don&rsquo;t need to worry. I have no intention of doing anything other than making him happy.&rdquo;

The two men exchanged a long look, and Sam&rsquo;s father finally nodded and stepped back.

Next all the kids seemed to feel the need to get in on the action, and Sam and Danny spent a few happy minutes hugging and kissing a handful of demanding little boys. Finally Cal and Wes brought huge bowls of salad and platters of lasagna from the kitchen, and Cal gestured expansively to the
empty seats.

&ldquo;Sit, sit,&rdquo; he said brightly. &ldquo;Let&rsquo;s eat.&rdquo;

Chairs were pulled out, seats were taken. Sam sat next to Danny, holding his hand, his thumb moving over the ring on Danny&rsquo;s finger as if he needed to assure himself it was actually there, that he had actually said yes. Danny leaned into his shoulder and looked around the table, taking in the faces of his brothers, their lovers, Sam&rsquo;s family and all of the messy, shining faces of the kids. He&rsquo;d never seen anything he thought more beautiful in his life.

He&rsquo;d come to Neverwood a lost, snotty fourteen year old brat and he&rsquo;d run away again at seventeen, sure he knew what he wanted. He hadn&rsquo;t, but those three years he&rsquo;d spent with Audrey had planted a seed, made him want something he&rsquo;d never had; a home, and a family. It had taken him an additional six years and the facing of his own personal demons, but he&rsquo;d found what he&rsquo;d been looking for.

Neverwood, his brothers, and Sam. His home. And his family.</lj-cut>

